public void updateReport1(M_DEP4_Summary_Entity1 entity1) {
    System.out.println("Report Date: " + entity1.getReportDate());

    M_DEP4_Summary_Entity1 existing = BRRS_M_DEP4_Summary_Repo1.findById(entity1.getReportDate())
        .orElseThrow(() -> new RuntimeException(
            "Record not found for REPORT_DATE: " + entity1.getReportDate()));

    try {
        for (int i = 10; i <= 50; i++) {
            String prefix = "R" + i + "_";
            // You can add more fields here if needed later
            String[] fields = {
            		"INSTITUTIONAL_SELECTOR",
            	    "TYPE_OF_ACCOUNT",
                "INTREST_RATE",
                "AMOUNT",
                "TOTAL_DEPOSIT",
                "PERCENTAGE_TOTAL_DEPOSIT"
                
            };

            for (String field : fields) {
                String getterName = "get" + prefix + field;
                String setterName = "set" + prefix + field;

                try {
                    Method getter = M_DEP4_Summary_Entity1.class.getMethod(getterName);
                    Method setter = M_DEP4_Summary_Entity1.class.getMethod(setterName, getter.getReturnType());

                    Object newValue = getter.invoke(entity1);
                    setter.invoke(existing, newValue);
                } catch (NoSuchMethodException e) {
                    // if any field is missing in entity class, skip it
                    continue;
                }
            }
        }
    } catch (Exception e) {
        throw new RuntimeException("Error while updating R11–R50 fields", e);
    }  

    BRRS_M_DEP4_Summary_Repo1.save(existing);
}


